const apiKey = 'b69ce63df91b692b402e8436d1099819';
const TMDBURL = 'https://api.themoviedb.org/3/movie';

export async function getMovieKeys(movieId) {
  console.log(movieId);
  return await fetch(`
  https://api.themoviedb.org/3/movie/${movieId}/videos?api_key=b69ce63df91b692b402e8436d1099819&language=ko
    `).then((res) => res.json());
}
